Brassed Off [1996]

The coal mine in a northern English village may be closing, which would
also mean the end of the miners' brass band. 

Starring: Pete Postlethwaite, Tara Fitzgerald and Ewan McGregor
          Brass Music performed by The Grimethorpe Colliery Band
Director: Mark Herman

NOTE: In the United States, United Kingdom, and South Africa, a coal mine
      and its structures are a &quot;colliery&quot;. In Australia, &quot;colliery&quot;
      generally refers to an underground coal mine.
